import React, { Component } from 'react';
import { Card, Form, Col, Button } from 'react-bootstrap';

export default class Voiture extends Component {
  submitVoiture = (e) => {
    e.preventDefault();
    // Add your logic here to process the car form
  }

  render() {
    return (
      <div>
      <Card className={"border border-dark bg-dark text-white"}>
        <Card.Header> Ajouter Voiture</Card.Header>
        <Card.Body>
          <Form onSubmit={this.submitVoiture} id="VoitureFormId">
            <Form.Row>
              <Form.Group as={Col}>
                <Form.Label> Marque </Form.Label>
                <Form.Control name="marque" type="text" className={"bg-dark text-white"} placeholder="Entrez Marque Voiture" />
              </Form.Group>
              <Form.Group as={Col}>
                <Form.Label> Modele </Form.Label>
                <Form.Control name="modele" type="text" className={"bg-dark text-white"} placeholder="Entrez Modele Voiture" />
              </Form.Group>
            </Form.Row>
            <Card.Footer style={{"textAlign": "right"}}>
              <Button size="sm" variant="success" type="submit"> Submit </Button>
            </Card.Footer>
          </Form>
        </Card.Body>
      </Card>
      </div>
    );
  }
}
